export default function mergeByName(t){var e=t.reduce(function(t,e){var n=t[e.name];return t[e.name]=n?Object.assign(Object.assign(Object.assign({},n),e),{},{options:Object.assign(Object.assign({},n.options),e.options),data:Object.assign(Object.assign({},n.data),e.data)}):e,t},{});return Object.keys(e).map(function(t){return e[t]})};